import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './Privacy.css';

function Privacy() {
  return (
    <div className="privacy">
      <Header />
      <main>
        <h1>Privacy</h1>
        <p>Learn about StreamFlix's privacy policy.</p>
      </main>
      <Footer />
    </div>
  );
}

export default Privacy;
